import React from 'react';
import styled from 'styled-components';
import '../App.css';
import Drapable from '../Drapable';
import Dropable from '../Dropable';

const Wrapper = styled.div`
    width:100%;
    padding:32px;
    display:flex;
    justify-content:center;

`;
const Item = styled.div`
    padding:8px;
    color:#555;
    background-color:white;
    border-radius:3px;
`;
const dropableStyle = {
    backgroundColor: '#555',
    width: '250px',
    height: '400px',
    margin: '32px',
};
export default class DndTest extends React.Component {
    render() {
        return (
            <Wrapper>
                <Dropable id='dr1' className={hover} style={{ backgroundColor: 'black', width: '250px', height: '400px', margin: '32px', }}>
                    <Drapable id='item1'>
                        <Item style={{ margin: '8px' }}>Some text</Item>
                    </Drapable>

                    <Drapable id='item2'>
                        <Item style={{ margin: '8px' }}>Some other text</Item>
                    </Drapable>
                </Dropable>
                <Dropable id='dr2' style={dropableStyle}>halo</Dropable>
            </Wrapper >
        );
    }
}
